import logo from './logo.svg';
import Icon from './pal-icon.png';
import PalLogo from './pal-logo.png';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">

        <nav className="header">
          <img src={menu} className="Header-Menu" alt="menu" />
          <img src={calllogo} className="Call-Logo" alt="call-logo" />
          <a href="#" className="GameBox">
            <span>게임</span>
            <span class="expend-arrow">+</span>
          </a>
        </nav>

        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
